import React from 'react';
import styled from '@emotion/styled';
import { motion } from 'framer-motion';
import { FaRobot, FaCode, FaMobile, FaCloud, FaShoppingBag } from 'react-icons/fa';
import './App.css';

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px;
`;

const Header = styled.header`
  padding: 20px 0;
  position: fixed;
  width: 100%;
  top: 0;
  background: rgba(255, 255, 255, 0.95);
  backdrop-filter: blur(5px);
  z-index: 1000;
  border-bottom-left-radius: 15px;
  border-bottom-right-radius: 15px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.05);
`;

const Nav = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px;
`;

const Logo = styled.h1`
  font-size: 1.5rem;
  color: #2d3436;
  margin: 0;
`;

const NavLinks = styled.div`
  display: flex;
  gap: 2rem;

  @media (max-width: 768px) {
    display: none;
  }
`;

const NavLink = styled.a`
  color: #2d3436;
  text-decoration: none;
  font-weight: 500;
  transition: color 0.3s ease;

  &:hover {
    color: #0984e3;
  }
`;

const Hero = styled.section`
  min-height: 100vh;
  display: flex;
  align-items: center;
  padding: 100px 0;
  background: linear-gradient(135deg, var(--secondary-color) 0%, var(--primary-color) 100%);
  color: white;
`;

const HeroContent = styled.div`
  max-width: 600px;
`;

const Title = styled(motion.h1)`
  font-size: 3.5rem;
  margin-bottom: 1rem;

  @media (max-width: 768px) {
    font-size: 2.5rem;
  }
`;

const Subtitle = styled(motion.p)`
  font-size: 1.25rem;
  margin-bottom: 2rem;
  opacity: 0.9;
`;

const Button = styled(motion.a)`
  display: inline-block;
  padding: 1rem 2rem;
  background: white;
  color: var(--primary-color);
  text-decoration: none;
  border-radius: 5px;
  font-weight: 600;
  transition: transform 0.3s ease;

  &:hover {
    transform: translateY(-2px);
  }
`;

const Apps = styled.section`
  padding: 100px 0;
  background: var(--light-background);
`;

const SectionTitle = styled.h2`
  text-align: center;
  font-size: 2.5rem;
  margin-bottom: 3rem;
  color: var(--text-color);
`;

const AppGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 2rem;
  padding: 0 20px;
`;

const AppCard = styled(motion.div)`
  background: white;
  padding: 2rem;
  border-radius: 10px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  text-align: center;
  transition: transform 0.3s ease, box-shadow 0.3s ease;
  cursor: pointer;

  &:hover {
    transform: translateY(-5px);
    box-shadow: 0 10px 20px rgba(0, 0, 0, 0.15);
  }
`;

const AppIcon = styled.div`
  font-size: 2.5rem;
  color: var(--primary-color);
  margin-bottom: 1rem;
`;

const AppTitle = styled.h3`
  font-size: 1.5rem;
  margin-bottom: 1rem;
  color: var(--text-color);
`;

const AppDescription = styled.p`
  color: var(--light-text);
  line-height: 1.6;
  margin-bottom: 1.5rem;
`;

const AppLink = styled.a`
  display: inline-block;
  padding: 0.5rem 1rem;
  background: var(--primary-color);
  color: white;
  border-radius: 5px;
  font-weight: 500;
  transition: background 0.3s ease;

  &:hover {
    background: var(--secondary-color);
  }
`;

function App() {
  return (
    <div className="App">
      <Header>
        <Nav>
          <Logo>Seagull Technologies</Logo>
          <NavLinks>
            <NavLink href="#apps">Our Apps</NavLink>
            <NavLink href="#about">About</NavLink>
            <NavLink href="#contact">Contact</NavLink>
          </NavLinks>
        </Nav>
      </Header>

      <Hero>
        <Container>
          <HeroContent>
            <Title
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8 }}
            >
              We Build AI Apps
            </Title>
            <Subtitle
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.2 }}
            >
              We specialize in developing consumer-facing AI mobile applications with enhanced user experience.
            </Subtitle>
            <Button
              href="#contact"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.4 }}
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              Get Started
            </Button>
          </HeroContent>
        </Container>
      </Hero>

      <Apps id="apps">
        <Container>
          <SectionTitle>Our AI Apps</SectionTitle>
          <AppGrid>
            <AppCard
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5 }}
              viewport={{ once: true }}
              onClick={() => window.open('https://dresscode.ai', '_blank')}
            >
              <AppIcon>
                <FaShoppingBag />
              </AppIcon>
              <AppTitle>Dresscode AI</AppTitle>
              <AppDescription>
                An AI-powered fashion recommendation app that helps users discover their perfect style based on personal preferences and body type.
              </AppDescription>
              <AppLink href="https://dresscode.ai" target="_blank" rel="noopener noreferrer">
                Learn More
              </AppLink>
            </AppCard>

            <AppCard
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.2 }}
              viewport={{ once: true }}
              style={{ opacity: 0.7 }}
            >
              <AppIcon>
                <FaRobot />
              </AppIcon>
              <AppTitle>Coming Soon</AppTitle>
              <AppDescription>
                We're working on exciting new AI applications. Stay tuned for more innovative solutions from Seagull Technologies.
              </AppDescription>
              <AppLink href="#contact">
                Get Notified
              </AppLink>
            </AppCard>

            <AppCard
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.4 }}
              viewport={{ once: true }}
              style={{ opacity: 0.7 }}
            >
              <AppIcon>
                <FaCloud />
              </AppIcon>
              <AppTitle>Coming Soon</AppTitle>
              <AppDescription>
                We're working on exciting new AI applications. Stay tuned for more innovative solutions from Seagull Technologies.
              </AppDescription>
              <AppLink href="#contact">
                Get Notified
              </AppLink>
            </AppCard>
          </AppGrid>
        </Container>
      </Apps>
    </div>
  );
}

export default App;
